Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import scala.Tuple2;

import java.sql.Timestamp;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Create a SparkSession
        org.apache.spark.SparkConf conf = new org.apache.spark.SparkConf().setAppName("HitRateCalculator");
        org.apache.spark.api.java.JavaSparkContext sc = new org.apache.spark.api.java.JavaSparkContext(conf);
        org.apache.spark.api.java.JavaSparkContext jsc = new org.apache.spark.api.java.JavaSparkContext(sc);
        org.apache.spark.api.java.JavaPairRDD<String, Timestamp> onsiteAttributedData = jsc.textFile("path/to/onsite_attributed_data.txt")
                .mapToPair(new PairFunction<String, String, Timestamp>() {
                    @Override
                    public Tuple2<String, Timestamp> call(String line) {
                        String[] fields = line.split(",");
                        return new Tuple2<>(fields[0], new Timestamp(Long.parseLong(fields[1]) * 1000));
                    }
                });

        // Create a map of top frequent queries and their last access time
        Map<String, Timestamp> topFrequentQueries = new HashMap<>();
        // Assuming you have a way to get the top frequent queries and their last access time
        // ...

        // Create a function to check if a query is in the cache and update its last access time
        Function<String, Timestamp> isInCacheAndUpdate = query -> {
            if (topFrequentQueries.containsKey(query)) {
                topFrequentQueries.put(query, new Timestamp(System.currentTimeMillis()));
                return true;
            }
            return false;
        };

        // Create a function to calculate hit rate for each record
        Function<Tuple2<String, Timestamp>, Double> hitRateFunction = tuple -> {
            String query = tuple._1;
            Timestamp timestamp = tuple._2;
            if (isInCacheAndUpdate.call(query)) {
                return 1.0; // cache hit
            } else {
                // send a request to retrieve such query and cache in the memory for 12 hours
                // ...
                topFrequentQueries.put(query, new Timestamp(System.currentTimeMillis() + 12 * 60 * 60 * 1000));
                return 0.0; // cache miss
            }
        };

        // Calculate the hit rate for each record in onsiteAttributedData
        JavaPairRDD<String, Double> hitRates = onsiteAttributedData.mapToPair(hitRateFunction);

        // Reduce the hit rates to get the total hit count and total request count
        Tuple2<Double, Double> hitRateSummary = hitRates.reduce((a, b) -> new Tuple2<>(a._1 + b._1, a._2 + b._2));

        // Calculate the hit rate
        double hitRate = hitRateSummary._1 / hitRateSummary._2;
        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }
}
```

